import React from "react";

export default function Projects() {
  return (
    <div>
      <div className="projects">
        <h2>Projects</h2>
        <p>
          Here are a few past projects I've worked on. Want to see more? Email
          me.
        </p>
      </div>
      
    </div>
  );
}
